@Repsol llevo mes y medio intentando que se solucione una avería. El servicio de atención al cliente y mantenimiento es muy deficiente, queja tras queja.
Han llegado a cerrar la incidencia un sábado sin mediar solución. 
A parte de cambiar de compañía, tengo alguna solución?

@enferactive Depende de lo que entiendas por buena enfermera. No? 
Hay un ranking de buenas o malas enfermeras o buenas o malas personas?
Ideología y valores influyen en cómo las personas nos enfrentamos a la vida, por lo que afectan a como ejerces tu profesión dentro del código deontológico

