@Ivan_Margon @AitorSolisGar @CODEPAsturias Y suma el estructural. Falta crónica de enfermeras en primaria, sociosanitaria,...
Y suma la necesidad de especialización en diferentes ámbitos.
Y vamos a un "mercado" perdón por el termino de profesionales con competencia entre comunidades e incluso países.

@Minecraft Hi! We can't play #Minecraft   Creative Mode on Nintendo switch multiplayer.
My partner can see me but He doesn't see me working. I can move but nothing I do remains in the created world and muy friend don't see me moving.
Can you hell me?

@Chefiasturias @cuidados @DadaCero La cosa cambia. Unos buenos prismáticos tienen más campo y son manejables para salir a ver estrellas.
Un telescopio bueno depende más del soporte casi que del propio telescopio. Te recomendaría huir de paquetes de muchos aumentos...
Si tienes presupuesto un celestron nextstar.

@AitorSolisGar No he visto ni asesores,ni expertos que hayan acertado mucho en ningún sitio. Los que acertaron luego fallaron y los que parecían fallar luego acertaban.
Prudencia y humildad muy necesarias y escuchar mucho. 
Datos y escucha para tomar buenas decisiones... Ah y suerte.

@alimensal @CODEPAsturias Doblajes y turnos largos deberían estudiarse en.funcion de la carga de trabajo.
Posibilidad de hacer horas extra igual para eventuales que los fijos. 
Eliminar la exclusividad de las enfemeras o incluso permitir temporalmente que se trabaje en dos administraciones públicas.

@alimensal Deben existir alternativas, y deben gestionarse de otra forma a las personas.
Lo que no puede ser es que ante situaciones como la que vivimos siga todo igual.
Desde el @CODEPAsturias hemos propuesto cambios legislativos que alivien un poco este tema.

@rcofinof Mensajes muy claros y que no generen confusión son más necesarios aún cuando el cansancio y la frustración apremian. 
Incorporar en los equipos, hacer partícipes a todos los agentes...
A ver si podemos ayudar en algo...

